When you create generic functions that use type parameters, like this: fn whatever<T: MyTrait>(t: T) { ... } Then rustc and LLVM will create a new copy of the function for each T type that the function is used with. This presents many opportunities for compiler optimizations based on which particular T each copy is working with, but these copies add up quickly in terms of code size. If you use trait objects instead of type parameters, like this: fn whatever(t: Box<MyTrait>) { ... }
// or
fn whatever(t: &MyTrait) { ... }
// etc... Then dynamic dispatch via virtual calls is used, and only a single version of the function is emitted in the .wasm . The downside is the loss of the compiler optimization opportunities and the added cost of indirect, dynamically dispatched function calls.

